import './App.css';
import { Router, Route } from 'react-router-dom';
import Home from './views/Home/Home';
import Landing from './views/Landing/Landing';

function App() {
  return (
    <div className="App">

      <Router>
        <Route path='/'>
          <Landing/>
        </Route>

        <Route path='/home'>
          <Home/>
        </Route>
      </Router>

    </div>
  );
}

export default App;
